import React, { useState, useEffect } from "react";

export const Volcano = ({ selectedVolcano }) => {
  // const [theVolcano, setTheVolcano] = useState();

  const URL = `https://my-volcanos.herokuapp.com/volcano/${selectedVolcano}`;

  useEffect(() => {
    fetch(URL)
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        console.log(data);
      });
  }, [URL]);

  return <div></div>;
};
